import { Link } from "react-router-dom";

const ShopEnlaces = () => {
  return (
    <div className="menu_shop">
      <ul className="shop_enlaces">
        <li>
          <Link to="./LaMarque">FEMME</Link>
        </li>
        <li>
          <Link to="">HOMME</Link>
        </li>
        <li>
          <Link to="">WETSUITS</Link>
        </li>
        <li>
          <Link to="">SHORTYS</Link>
        </li>
        <li>
          <Link to="">TOPS</Link>
        </li>
      </ul>
    </div>
  );
};

export default ShopEnlaces;
